//import logo from './logo.svg';
import './Style.css';
import { Routes, Route } from 'react-router-dom';
import Header from './Component/Header';
import Home from './Component/Home';
import ProductList from './Component/Product/ProductList';
import AddProduct from './Component/Product/AddProduct';
import EditProduct from './Component/Product/EditProduct';
import TypeList from './Component/Type/TypeList';
import AddType from './Component/Type/TypeAdd';
import EditType from './Component/Type/TypeEdit';
import Sale from './Component/Sale';
import SaleList from './Component/SaleList';

function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>
        <Route path="/" element={ <ProductList/> } />
        <Route path="/productlist" element={ <ProductList/> } />
        <Route path="/addproduct" element={ <AddProduct/> } />
        <Route path="/editproduct" element={ <EditProduct/> } />
        <Route path="/typelist" element={ <TypeList/> } />
        <Route path="/addtype" element={ <AddType/> } />
        <Route path="/edittype" element={ <EditType/> } />
        <Route path="/sale" element={ <Sale/> } />
        <Route path="/salelist" element={ <SaleList/> } />
      </Routes>
    </div>
  );
}

export default App;
